ReactDOM.render(
  // use strictと同じ
  <React.StrictMode>
    <Component1 name="山田" jop="歌手" />
    <h2>{val1}</h2>
  </React.StrictMode>,
  document.getElementById("root")
);

// If you want to start measuring performance in your app, pass a function
